SELECT ?grandparent WHERE {
  # Step 1: Find the father of Charles I of Hungary who is a royalty
  { 
    SELECT ?father WHERE {
      <http://dbpedia.org/resource/Charles_I_of_Hungary> dbo:father ?father .
      FILTER(?father IN (<http://dbpedia.org/resource/Hungarian_Royal_Family>))
    }
  }

  # Step 2: Find the child of that father
  { 
    SELECT ?child WHERE {
      ?father dbo:child ?child .
    }
  }

  # Step 3: Find the predecessor of Stephen V of Hungary and then their child
  { 
    SELECT ?predecessorChild WHERE {
      <http://dbpedia.org/resource/Stephen_V_of_Hungary> dbo:predecessor ?predecessor .
      ?predecessor dbo:child ?predecessorChild .
    }
  }

  # Combine the results to find the grandparent
  FILTER(?grandparent IN (?father, ?predecessorChild))
}
```

