    FILTER(CONTAINS(?title, "King") || CONTAINS(?title, "Queen"))
  }

  # Find the spouse of the identified royal child
  { ?royalChild dbo:spouse ?spouse . }

  # Find the predecessor of this spouse (assuming we have a property indicating predecessor)
  { ?spouse dbo:predecessor ?predecessor . }
}
