PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT ?rulingParty ?personName
WHERE {
  # Step 1: Find the ruling party in Central, Louisiana
  { 
    SELECT ?rulingParty WHERE {
      <http://dbpedia.org/resource/Central,_Louisiana> dbo:rulingParty ?rulingParty .
    }
  }

  UNION

  # Step 2: Find Tisha Sterling's parent and identify the person with the same birth name
  { 
    SELECT ?personName WHERE {
      ?parent rdfs:label "Tisha Sterling" ;
               dbo:birthPlace ?birthPlace .
      ?person dbo:birthName ?birthName ;
                dbo:birthPlace ?birthPlace .
      FILTER(?birthName = "Tisha Sterling")
    }
  }

  UNION

  # Step 3: Find Roger Pryor's spouse and identify the person with the same birth name
  { 
    SELECT ?personName WHERE {
      ?spouse rdfs:label "Roger Pryor" ;
               dbo:spouse ?person .
      ?person dbo:birthName ?birthName ;
                dbo:birthPlace ?birthPlace .
      FILTER(?birthName = "Roger Pryor")
    }
  }
}
```

